import React from 'react';
import './App.css';

const Add = props => <h1>{props.a + props.b}</h1>

const Layout = props => (
  <React.Fragment>
      <header>
      </header>
      <main>
        {props.children}
      </main>
      <footer>My Footer</footer>
  </React.Fragment>
);

function App() {
  return (
    <div>
      <Layout>
      <p>Page1</p>
      <Add a={2} b={3}></Add>
    </Layout>
    <br/>
    <br/>
    <Layout>
      <p>Page2</p>
      <Add a={3} b={3}></Add>
    </Layout>
    </div>


  );
}

export default App;
